import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import styled from 'styled-components';

const StyledLink = styled.div`
text-align: center;
border-radius: 3px;
padding: 5px 20px;
margin: 0 10px;
font-weight: 600;
border: 2px solid white;

background: black;
color: white;`;

class Cabecalho extends React.Component {
    render(){
        return (
            <div>
            <React.Fragment>
                <StyledLink>
            <Link className="pedido" to="/pedido">Pedido</Link>
            <Link className="cardapio" to="/cardapio">Card√°pio</Link>
            <Link className="cliente" to="/cliente">Cadastro de Cliente</Link>
            <Link className="carrinho " to="/adicionar"> Carrinho</Link>
            </StyledLink>
            </React.Fragment>
            </div>
        );
    }
}
export default Cabecalho;
